import React from 'react';
import { useNavigate } from 'react-router-dom'; // Import useNavigate, not Link
import { useAuth } from '../App';

const DashboardPage = () => {
  const { session } = useAuth();
  const navigate = useNavigate();

  const handleLogout = async () => {
    // ... your logout logic ...
  };

  const goToSettings = () => {
    navigate('/settings'); // Use navigate to go to the settings page
  };

  if (!session) {
    return <div>Not authenticated. Redirecting...</div>;
  }

  return (
    <div>
      <h1>Welcome to your Dashboard, {session?.user?.email}!</h1>
      <p>User ID: {session?.user?.id}</p>
      <button onClick={handleLogout}>Logout</button>
      <button onClick={goToSettings}>Go to Settings</button> {/* Now it's a <button> */}
      {/* Add other dashboard content here */}
    </div>
  );
};

export default DashboardPage;
